(1, 18, '2015-10-02 06:40:59', 'Intro', '&lt;p&gt;United Insurance Co. (Nepal) Limited is an ISO 9001:2000 certified insurance company.The company has started its operation from December 1, 1993 (Mangsir 16, 2050) after its registration with the Company Registrator&amp;#39;s Office and approved byInsurance Board. The company is promoted by leading industrialists and reputed trading and commercial houses of Nepal and have a wide participation. The Authorised Capital of the Company is Rs. 50 crores, Issued Capital 30.24&amp;nbsp;crores, out of which Rs. 30.24&amp;nbsp;crores have already been paid.&lt;/p&gt;\r\n', '', 'Published', 'intro', 'Public', '', 'English'),
