(6, 18, '2015-10-02 04:35:25', 'Mission, Vision & Goal', '&lt;p&gt;The Company&amp;rsquo;s vision is to Contribute to the development of the National Economy by ensuring prompt insurance services to the non-life policyholders.&lt;/p&gt;\r\n\r\n&lt;p&gt;Its mission is to Provide the best insurance service,Valuing customers in all ways possible and making them feel special through individualistic approach, believing in passion, innovations, integrity, flexibility and positive approach.&lt;/p&gt;\r\n', '', 'Published', 'Allow', 1, 'mission-vision-goal', 1, 'Public', '', 0, ''),
(7, 18, '2015-10-02 04:36:10', 'Fire Insurance', '&lt;h3&gt;&lt;strong&gt;Fire and Allied Perils Insurance &lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;The subject matter of fire insurance may be any kind of movable or immovable property having pecuniary value, some of the examples are building, plant, machinery, furniture, fixtures and fittings, household articles, stocks and merchandise etc.&lt;/p&gt;\r\n\r\n&lt;p&gt;Fire policy can be extended to cover the following additional risks:&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Earthquake (Fire and Shock)&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Storm, Tempest, Flood and Inundation&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Aircraft Damage or articles dropped there from&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Explosion&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Land slide&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Riot Strike damage&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Malicious damage&lt;/p&gt;\r\n\r\n&lt;p&gt;8. Sabotage &amp;amp; Terrorism&lt;/p&gt;\r\n\r\n&lt;p&gt;9. Impact Damage&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Detail&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;table class=&quot;table&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;th&gt;S.N.&lt;/th&gt;\r\n			&lt;th&gt;Title&lt;/th&gt;\r\n			&lt;th&gt;Explanation&lt;/th&gt;\r\n			&lt;th&gt;&amp;nbsp;&lt;/th&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;1&lt;/td&gt;\r\n			&lt;td&gt;Insured Property&lt;/td&gt;\r\n			&lt;td&gt;Building or its contents and other related properties&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;2&lt;/td&gt;\r\n			&lt;td&gt;Location&lt;/td&gt;\r\n			&lt;td&gt;Village/Tole, Ward No., District, Zone, Plot (Kitta) No., House No.,&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Detail of Four-sides (Char Killa) of Property etc.&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;3&lt;/td&gt;\r\n			&lt;td&gt;Occupancy of&lt;/td&gt;\r\n			&lt;td&gt;Residental, Shop, Factory, Warehouse etc.&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Building&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;4&lt;/td&gt;\r\n			&lt;td&gt;Sum Insured&lt;/td&gt;\r\n			&lt;td&gt;Valuation of owner&lt;/td&gt;\r\n			&lt;td&gt;Valuation of market&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Valuation of assessor&lt;/td&gt;\r\n			&lt;td&gt;Valuation of loan amount&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;5&lt;/td&gt;\r\n			&lt;td&gt;Discount on&lt;/td&gt;\r\n			&lt;td&gt;Corporate/Agency&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Premium&lt;/td&gt;\r\n			&lt;td&gt;Use of Fire Fighting Appliances&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;6&lt;/td&gt;\r\n			&lt;td&gt;Additional Risk&lt;/td&gt;\r\n			&lt;td&gt;Riot Strike Damage (RSD), Terrorism, Malicious Damage&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;7&lt;/td&gt;\r\n			&lt;td&gt;Others&lt;/td&gt;\r\n			&lt;td&gt;Storey, Construction, Owner, Sum Insured, Period of Insurance,&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n			&lt;td&gt;Risk Coverage, Discount, Excess, Signature, KYC etc.&lt;/td&gt;\r\n			&lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;Started from 1st December 1993&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h3&gt;Household Effects Insurance&lt;/h3&gt;\r\n\r\n&lt;p&gt;Under this insurance UICL will indemnity the insured against loss of or damage to the private dwelling house and its contents therein by any of the following perils without an extra premium. The main objective of this insurance is to protect the material interest of the service - holders on their residential buildings of RCC/RBC construction and the household there in up to the sum insured of Rs. 40, 00,000.00 against the risks mentioned below:&lt;/p&gt;\r\n\r\n&lt;p&gt;1. Fire, lightning, Explosion of Domestic Appliances, Earthquake&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Storm, Flood&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Subsidence and Landslide&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Riot Strike Damage&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Malicious Damage &amp;amp; Terrorism&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Aircraft Damage or articles dropped there from&lt;/p&gt;\r\n\r\n&lt;p&gt;7. Burglary and Housebreaking&lt;/p&gt;\r\n\r\n&lt;p&gt;8. Impact by vehicle or Animal&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;Started from 1st December 1993&lt;/strong&gt;&lt;/h3&gt;\r\n', '', 'Draft', 'Disallow', 2, 'fire-insurance', 2, 'Public', '', 0, '/insurance-in-nepal/upload/images/fire.png');
