(160, 18, '2017-11-07 09:45:58', 'Trainee / Junior Assistant - Few	', '&lt;p&gt;United Insurance Co. (Nepal) Ltd. is a leading national Insurance company invites applications from highly motivated and skilled and result oriented Nepalese citizen for the following position for Head Office &amp;amp; its Branches:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Trainee / Junior Assistant - Few&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Education and Qualification :&lt;/strong&gt;&amp;nbsp; Intermediate in any Field. Preferably Bachelors Degree. &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Age&amp;nbsp;:&amp;nbsp;&lt;/strong&gt; Not exceeding 25 years as on date of application&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;General Requirements:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull;&amp;nbsp;&amp;nbsp; &amp;nbsp;Smart, intelligent &amp;amp; pleasant personality&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull;&amp;nbsp;&amp;nbsp; &amp;nbsp;Proficient in written /spoken English and Nepali and be complete literate with working knowledge of MS office applications&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull;&amp;nbsp;&amp;nbsp; &amp;nbsp;Having valid two wheeler driving license.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please apply with updated Curriculum Vitae mentioning two reference persons and their respective contact details specifying the branch in application letter and email to: uic@mail.com.np&lt;/p&gt;\r\n\r\n&lt;p&gt;No phone calls will be entertained in this regard.&lt;/p&gt;\r\n\r\n&lt;p&gt;No Postal Applications will be accepted.&lt;/p&gt;\r\n\r\n&lt;p&gt;The last date of submission of application will be 7 days from the date of advertisement (within 2074/6/27)&lt;/p&gt;\r\n\r\n&lt;p&gt;Salaries and benefit will be as per company rules. Only shortlisted candidates will be called for an interview. Management reserves the right even to cancel the whole acquisition process without mentioning whatsoever reasons to the all concerned.&lt;/p&gt;\r\n', '&lt;p&gt;United Insurance Co. (Nepal) Ltd. is a leading national Insurance company invites applications from highly motivated and skilled and result oriented Nepalese citizen for the following position for Head Office &amp;amp; its Branches:.&lt;/p&gt;\r\n', 'Published', 'Allow', 20, 'trainee-junior-assistant-few', 5, 'Public', '', 0, ''),
