(226, 21, '2019-08-15 04:44:00', 'Property Insurance', '&lt;p&gt;Property Insurance Policy is a comprehensive policy that covers property such as Buildings, Factories, Shop, stocks, Showrooms, Hospitals and other forms of assets against natural perils such as Fire and lightening related, Storm related, Water related, Land related, Subsidence related, Explosion related, Riot, Strike &amp;amp;Terrorism related risks.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:-1.0in&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;UICL provides three different types of policy in this Insurance:&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Home Insurance&lt;/li&gt;\r\n	&lt;li&gt;General Property Insurance&lt;/li&gt;\r\n	&lt;li&gt;Lop Industrial/Commercial Risk Property&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Started from 15th January&amp;nbsp;2019&lt;/strong&gt;&lt;/p&gt;\r\n', '', 'Published', 'Allow', 2, 'property-insurance', 1, 'Public', '', 0, '/insurance-in-nepal/upload/images/Products/property(1).jpg');
